import React, { useState } from "react";
import { Accordion, Card, Button, ListGroup, Dropdown } from "react-bootstrap";

const credits = {
    credits_per_user: {
        1: [
            {
                debtor: {
                    id: 11,
                    username: "david@email.com",
                    email: "david@email.com",
                    name: "david",
                },
                creditor: {
                    id: 1,
                    username: "jeus@email.com",
                    email: "jeus@email.com",
                    name: "Jeus",
                },
                group: 6,
                amount: "598.32",
            },
            {
                debtor: {
                    id: 10,
                    username: "charlie@email.com",
                    email: "charlie@email.com",
                    name: "charlie",
                },
                creditor: {
                    id: 1,
                    username: "jeus@email.com",
                    email: "jeus@email.com",
                    name: "Jeus",
                },
                group: 6,
                amount: "297.36",
            },
        ],
        3: [
            {
                debtor: {
                    id: 10,
                    username: "charlie@email.com",
                    email: "charlie@email.com",
                    name: "charlie",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "150.96",
            },
            {
                debtor: {
                    id: 9,
                    username: "bob@email.com",
                    email: "bob@email.com",
                    name: "bob",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "280.32",
            },
            {
                debtor: {
                    id: 12,
                    username: "ema@email.com",
                    email: "ema@email.com",
                    name: "ema",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "173.32",
            },
        ],
    },
};

const debts = {
    debts_per_user: {
        11: [
            {
                debtor: {
                    id: 11,
                    username: "david@email.com",
                    email: "david@email.com",
                    name: "david",
                },
                creditor: {
                    id: 1,
                    username: "jeus@email.com",
                    email: "jeus@email.com",
                    name: "Jeus",
                },
                group: 6,
                amount: "598.32",
            },
        ],
        10: [
            {
                debtor: {
                    id: 10,
                    username: "charlie@email.com",
                    email: "charlie@email.com",
                    name: "charlie",
                },
                creditor: {
                    id: 1,
                    username: "jeus@email.com",
                    email: "jeus@email.com",
                    name: "Jeus",
                },
                group: 6,
                amount: "297.36",
            },
            {
                debtor: {
                    id: 10,
                    username: "charlie@email.com",
                    email: "charlie@email.com",
                    name: "charlie",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "150.96",
            },
        ],
        9: [
            {
                debtor: {
                    id: 9,
                    username: "bob@email.com",
                    email: "bob@email.com",
                    name: "bob",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "280.32",
            },
        ],
        12: [
            {
                debtor: {
                    id: 12,
                    username: "ema@email.com",
                    email: "ema@email.com",
                    name: "ema",
                },
                creditor: {
                    id: 3,
                    username: "tim@email.com",
                    email: "tim@email.com",
                    name: "tim",
                },
                group: 6,
                amount: "173.32",
            },
        ],
    },
};

function GroupCreditDebit({ groupDetails }) {
    const [openMember, setOpenMember] = useState(null);

    const handleMemberClick = (memberId) => {
        if (openMember === memberId) {
            // Clicked on the currently open member, close it
            setOpenMember(null);
        } else {
            // Clicked on a different member, open it
            setOpenMember(memberId);
        }
    };

    console.log(groupDetails);

    return (
        <Accordion defaultActiveKey={null}>
            {groupDetails &&
                groupDetails.members &&
                groupDetails.members.map((member) => (
                    <Card key={member.id}>
                        <Card.Header>
                            <Accordion.Toggle
                                as={Button}
                                variant="link"
                                eventKey={member.id.toString()}
                                onClick={() => handleMemberClick(member.id)}
                            >
                                {member.name}
                            </Accordion.Toggle>
                        </Card.Header>
                        <Accordion.Collapse eventKey={member.id.toString()}>
                            <Card.Body>
                                <h5>Credits:</h5>
                                <ListGroup>
                                    {credits.credits_per_user[member.id].map(
                                        (credit, index) => (
                                            <ListGroup.Item key={index}>
                                                {credit.debtor.name} owes you $
                                                {credit.amount}
                                            </ListGroup.Item>
                                        )
                                    )}
                                </ListGroup>
                                <h5>Debts:</h5>
                                <ListGroup>
                                    {debts.debts_per_user[member.id].map(
                                        (debt, index) => (
                                            <ListGroup.Item key={index}>
                                                You owe {debt.creditor.name} $
                                                {debt.amount}
                                            </ListGroup.Item>
                                        )
                                    )}
                                </ListGroup>
                            </Card.Body>
                        </Accordion.Collapse>
                    </Card>
                ))}
        </Accordion>
    );
}

export default GroupCreditDebit;
